query GetSubsectionOverviewData($subsectionUniqueCode: String!, $moduleUniqueCode: String!, $categoryUniqueCodeIn: [String!]) {
  subsection(
    filter: {uniqueCode: $subsectionUniqueCode, moduleUniqueCode: $moduleUniqueCode, categoryUniqueCodeIn: $categoryUniqueCodeIn}
  ) {
    id
    name
    uniqueCode
    icon
    locked
    currentUserScore
    isDiagnosticQuizEnabled
    subsectionQuizSession {
      id
      currentStep
      __typename
    }
    summary {
      id
      released
      wistiaVideoDuration
      __typename
    }
    subsectionNumber
    subsectionQuizAvailable
    preActivitiesNotice
    postActivitiesNotice
    module {
      id
      title
      subtitle
      uniqueCode
      releaseType
      schoolYear
      currentUserEnrolment {
        id
        isTrial
        isActive
        enrolmentPlan
        __typename
      }
      examBoardSubject {
        id
        board
        subject
        boardName
        boardObject {
          id
          __typename
        }
        subjectName
        subjectObject {
          id
          qualification {
            uniqueCode
            __typename
          }
          __typename
        }
        __typename
      }
      __typename
    }
    definitionGroups(filter: {categoryUniqueCodeIn: $categoryUniqueCodeIn}) {
      activityType: __typename
      id
      completed
      uniqueCode
      orderNumber: definitionGroupNumber
      recallType
      removeVisceralisation
      definitions {
        id
        responsesPendingMarking: definitionRecallResponses(filter: {isMarked: false}) {
          id
          __typename
        }
        __typename
      }
    }
    progressQuizGroups(filter: {categoryUniqueCodeIn: $categoryUniqueCodeIn}) {
      activityType: __typename
      id
      completed
      uniqueCode
      quizType
      orderNumber: progressQuizGroupNumber
      progressQuizQuestions {
        id
        __typename
      }
      name
    }
    articleLessons(filter: {categoryUniqueCodeIn: $categoryUniqueCodeIn}) {
      activityType: __typename
      id
      completed
      uniqueCode
      title
      length
      orderNumber: lessonNumber
    }
    examHowToLessons(filter: {categoryUniqueCodeIn: $categoryUniqueCodeIn}) {
      activityType: __typename
      id
      completed
      uniqueCode
      title
      length
      orderNumber: lessonNumber
      examPaperQuestion {
        examPaperQuestionParts {
          marksAvailable
          __typename
        }
        __typename
      }
      inVideoQuizQuestions {
        id
        __typename
      }
    }
    videoLessons(filter: {categoryUniqueCodeIn: $categoryUniqueCodeIn}) {
      activityType: __typename
      id
      completed
      uniqueCode
      title
      length
      orderNumber: lessonNumber
      inVideoQuizQuestions {
        id
        __typename
      }
    }
    __typename
  }
}
